import Link from 'next/link';

const Home = () => {
    return (
      <>
        <div>
            안녕하세요 오형남입니다!
            <Link href={{pathname: 'user/profile', query: '오형남' }} ><a>프로필</a></Link>
        </div>
      </>  
    );
}

export default Home;
